# Admin Settings
##  Set 'user' as the Default User Role (Admin Panel -> Settings -> General -> Default User Role)
curl "https://lieutenant-dev.kih.com.sg/api/v1/auths/admin/config" \
  -H "authorization: Bearer $TOKEN" \
  -H "content-type: application/json" \
  --data-raw '{"SHOW_ADMIN_DETAILS":true,"ENABLE_SIGNUP":true,"DEFAULT_USER_ROLE":"user","JWT_EXPIRES_IN":"-1","ENABLE_COMMUNITY_SHARING":true,"ENABLE_MESSAGE_RATING":true}'

##  Set GPT-4o Mini as the Default Model (Admin Panel -> Settings -> Users)
curl "https://lieutenant-dev.kih.com.sg/api/v1/configs/default/models" \
  -H "authorization: Bearer $TOKEN" \
  -H "content-type: application/json" \
  --data-raw '{"models":"GPT-4o Mini"}' ;

curl "https://lieutenant-dev.kih.com.sg/api/v1/users/permissions/user" \
  -H "authorization: Bearer $TOKEN" \
  -H "content-type: application/json" \
  --data-raw '{"chat":{"deletion":true,"editing":true,"temporary":true}}' ;
  
curl "https://lieutenant-dev.kih.com.sg/api/config/model/filter" \
  -H "authorization: Bearer $TOKEN" \
  -H "content-type: application/json" \
  --data-raw '{"enabled":false,"models":[""]}' ;

##  Set GPT-4o Mini as the External Task Model (Admin Panel -> Settings -> Interface)
