  -H "authorization: Bearer $TOKEN" \
  -H 'content-type: application/json' \
  --data-raw '{"TASK_MODEL":"","TASK_MODEL_EXTERNAL":"GPT-4o Mini","TITLE_GENERATION_PROMPT_TEMPLATE":"","TAGS_GENERATION_PROMPT_TEMPLATE":"","ENABLE_SEARCH_QUERY":true,"SEARCH_QUERY_GENERATION_PROMPT_TEMPLATE":"","TOOLS_FUNCTION_CALLING_PROMPT_TEMPLATE":""}'

##  Set Default Prompt Suggestions (Admin Panel -> Settings -> Interface)
